import React from "react";
import navIcon from "../assets/navIcon.svg";
import ''
const Navbar = () => {
  return (
    <div className="container flex rounded-[1.31rem] items-center justify-between px-4 py-4 mx-auto my-4 w-[71.063rem] drop-shadow-2xl  border-2">
      <div className=" font-[itim] text-4xl pl-4 items-center justify-center">
        <p>earthly.ie</p>
      </div>
      <ul className="flex list-none gap-16 font-[inter] items-center justify-center text-[1.375rem] pr-4">
        <li>Home</li>
        <li>Shop</li>
        <li>About Us</li>
        <li>
          <button className="">Get in Touch</button>
        </li>
        <li className="scale-[]">
          <img src={navIcon} alt="Cart Icon" />
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
